//////////////////////////////////////////////////////////////////
// DPlus Party
//////////////////////////////////////////////////////////////////
var lastPeerId = null;
var peer = null;
var isRemote = false;
var isHost = false;
var conn = null;
var peers = [];
/**
 * Create the Peer object for our end of the connection.
 *
 * Sets up callbacks that handle any events related to our
 * peer object.
 */
function initialize() {
    // Prevent multiple initializations
    if (peer !== null) {
        return;
    }

    // Create own peer object with connection to shared PeerJS server
    // TODO: Add error notification and do not start chat if there is an error
    peer = new Peer(null, {
        host: 'dplus-2.uc.r.appspot.com',
        path: '/dplus',
        secure: true,
        debug: 3
    });

    peer.on('open', function (id) {
        // Workaround for peer.reconnect deleting previous id
        if (peer.id === null) {
            log('Received null id from peer open');
            peer.id = lastPeerId;
        } else {
            lastPeerId = peer.id;
            // Generate hash if needed
            if (!location.hash) {
                location.hash = peer.id;
                isHost = true;
                //peer.connect(peer.id);
                injectChat();
            }
            log('ID: ' + peer.id);
            if (location.hash && !isHost) {
                join();
            }
        }
    });
    peer.on('connection', function (c) {
        c.on('open', function () {
            if (!video_element.paused) {
                mediaPlayer.dispatchEvent(spaceKeyPressEvent);
                // Send pause to all currently connected peers
                for (let i = 0; i < peers.length; i++) {
                    if ((peers[i] != null)) {
                        const data = {
                            id: peer.id,
                            from: $('#chat-username').val(),
                            message: 'paused the video',
                            action: 'pause',
                        };
                        webRTCSend(data);
                    }
                }
            }
            peers.push(c);
            log('Connected to: ' + c.peer);
        });

        // Handle incoming data (messages only since this is the signal sender)
        c.on('data', function (data) {
            let d = JSON.parse(data);
            switch (d.action) {
                case 'message':
                    insertMessage(d, false);
                    break;
                case 'rename':
                    renameRemoteUser(d);
                    break;
                case 'pause':
                case 'play':
                default:
                    handleVideoActions(d);
                    break;
            }
        });

        c.on('close', function() {
            peers.pop(peers[peers.length - 1]);
            log('Connection destroyed');
        });

        c.on('error', function (err) {
            log(err);
            const data = {
                id: peer.id,
                from: $('#chat-username').val(),
                action: 'error',
                message: err
            };
            insertMessage(data, true);
        });
    });
}

/**
 * Create the connection between the two Peers.
 *
 * Sets up callbacks that handle any events related to the
 * connection and data received on it.
 */
function join() {
    // Prevent multiple joins
    if (conn !== null) {
        return;
    }

    // Create connection to destination peer specified in the input 
    let key = location.hash.split('#')[1];
    conn = peer.connect(key, {reliable: true});

    conn.on('open', function () {
        log('Connected to: ' + conn.peer);
        injectChat();
        if (!video_element.paused) {
            mediaPlayer.dispatchEvent(spaceKeyPressEvent);
            window.dispatchEvent(new Event('joined'));
        }
    });
    // Handle incoming data
    conn.on('data', function (data) {
        let d = JSON.parse(data);
        d.message = d.message.hexDecode();
        switch (d.action) {
            case 'message':
                insertMessage(d, false);
                break;
            case 'rename':
                renameRemoteUser(d);
                break;
            case 'pause':
            case 'play':
            default:
                handleVideoActions(d);
                break;
        }
    });
    conn.on('close', function () {
        log('Connection closed');
    });
    conn.on('error', function (err) {
        log(err);
        const data = {
            id: conn.id,
            from: $('#chat-username').val(),
            action: 'error',
            message: err
        };
        insertMessage(data, true);
    });
}

function webRTCSend(data,  peerid = -1) {
    data.message = data.message.hexEncode();
    // host will send out data to all connected peers since
    // only host knows who is connected
    if (isHost) {
        for (let i = 0; i < peers.length; i++) {
            if ((peers[i] != null) && ((peers[i].peer == peerid) || (peerid == -1))) {
                peers[i].send(JSON.stringify(data));
                log('Sent: ' + JSON.stringify(data));
            } else {
                log('Data not sent, non-existant peer or data originates from peer');
            }
        }
    } else {
        if (conn && conn.open) {
            conn.send(JSON.stringify(data));
            log('Sent: ' + JSON.stringify(data));
        } else {
            log('Connection not initialized or closed');
        }
    }
}

// Functions to encode and decode strings to support emojis
// Basically, loop through each character and turn into hex and then convert back from hex
// (Parsing emojis without hex results in an out of bounds error when sending through PeerJS)
String.prototype.hexEncode = function() {
    var hex;

    var result = '';
    for (let i = 0; i < this.length; i++) {
        hex = this.charCodeAt(i).toString(16);
        result += ("000" + hex).slice(-4);
    }

    return result;
}

String.prototype.hexDecode = function() {
    var hexes = this.match(/.{1,4}/g) || [];
    var back = '';
    for (let j = 0; j < hexes.length; j++) {
        back += String.fromCharCode(parseInt(hexes[j], 16));
    }

    return back;
}

/********************CHAT FUNCTIONS********************/
////////////////////////////////////////////////////////
function insertMessage(data, fromMe) {
    if (data.message == '') {
        return false;
    }

    if (fromMe) {
        if (data.action === 'play' || data.action === 'pause' || data.action === 'error') {
            let msgActionHTML = 
            '<div class="chat-action">' + data.message +
            '<div class="chat-user usr-local" style="text-align: right;">' +
               data.from +
            '</div></div>';
            $('#chat-messages').append(msgActionHTML);
        } else {
            let msgHTML = 
            '<div class="chat-message-user">' + data.message +
            '<div class="chat-user usr-local" style="text-align: right;">' +
                data.from +
            '</div></div>';
            $('#chat-messages').append(msgHTML);
        }
        webRTCSend(data);
    } else {
        if (data.action === 'play' || data.action === 'pause' || data.action === 'error') {
            let msgActionHTML = 
            '<div class="chat-action">' + data.message +
            '<div class="chat-user usr-' + data.id + '" style="text-align: right;">' +
               data.from +
            '</div></div>';
            $('#chat-messages').append(msgActionHTML);
        } else {
            let msgRemoteHTML = 
            '<div class="chat-message-remote">' + data.message +
            '<div class="chat-user usr-' + data.id + '" style="text-align: right;">' +
            data.from +
            '</div></div>';
            $('#chat-messages').append(msgRemoteHTML);
        }

        if (isHost) {
            for (let i = 0; i < peers.length; i++) {
                // Only send data to peers that are not the originating peer
                if ((peers[i] != null) && (peers[i].peer != data.id)) {
                    webRTCSend(data, peers[i].peer);
                }
            }
        }
    }

    $('#chat-messages').scrollTop($('#chat-messages').prop('scrollHeight'));
}

function renameRemoteUser(data) {
    let usrNames = '.usr-' + data.id;
    for (let i = 0; i <  $(usrNames).length; i++) {
        $(usrNames).get(i).textContent = data.from;
    }
    if (isHost) {
        for (let i = 0; i < peers.length; i++) {
            // Only send data to peers that are not the originating peer
            if ((peers[i] != null) && (peers[i].peer != data.id)) {
                webRTCSend(data, peers[i].peer);
            }
        }
    }
}

function saveUserName() {
    $('#chat-user-info').css('height', '0px');
    $('#chat-user-info').css('padding', '0px');
    let usrNames = '.usr-local';
    for (let i = 0; i <  $(usrNames).length; i++) {
        $(usrNames).get(i).textContent = $('#chat-username').val();
    }
    const data = {
        id: peer.id,
        from: $('#chat-username').val(),
        action: 'rename',
    };
    webRTCSend(data);
    $('#chat-send').focus();
}

function changeUserName() {
    $('#chat-user-info').css('height', '');
    $('#chat-user-info').css('padding', '');
    $('#chat-username').focus();
}

